import React, { } from 'react';
import '../../App.css';
import '../../Form.css';

var tnv;
/*Currently contains the Search, Currency, logo,
log in, create account, cart, and calls all the buttons
that are in the AppButtons.js file*/
class Tracking extends React.Component {
    constructor(props) {
        super(props);
        this.state = { value: '' };
        tnv = require('tracking-url');

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange(event) {
        this.setState({ value: event.target.value });
    }

    handleSubmit(event) {
        var str = JSON.stringify(tnv(this.state.value));
        var tmp, tmp2, tmp3;
        if (str !== "null") {
            tmp = str.split(",");
            tmp2 = tmp[1].split(":\"");
            tmp3 = tmp2[1].split("\"");
            if (window.confirm("You are about to be redirected to an outside link. Press Ok to confirm")) {
                window.location.href = tmp3[0]; // brings user to page
            };
        } else {
            alert("Null number");
        }
        //str = tmp3[0].link(tmp3[0]) ;
        //window(str); // prints out package URL  // make clickable
        // 9400128206335334236415
        event.preventDefault();
    }

    render() {
        return (
            <div className="app">
                <p className="heading">Tracking</p>
                <Card title="Default size card" extra={<a href="#">More</a>} style={{ width: 300 }}>
                    <p>Card content</p>
                    <p>Card content</p>
                    <p>Card content</p>
                </Card>
                <form onSubmit={this.handleSubmit} className="form">

                    <div className="form-inputs">
                        <label className="form-label1">
                            Enter order number below
                        </label>
                        <div className="form-input">
                            <input
                                value={this.state.value}
                                onChange={this.handleChange}
                                type="text"
                                name="name"
                                className="trackbox"
                                placeholder="Enter tracking number"
                                style={{
                                    display: "block",
                                    marginleft: "auto",
                                    marginright: "auto",
                                    paddingleft: "10px",
                                    outline: "black",
                                    borderradius: "2px",
                                    height: "40px",
                                    width: "102%"
                                }}
                            />
                        </div>
                    </div>

                    <div className="form-input">
                        <div
                            style={{
                                paddingTop: "40px"
                            }}>
                            <input
                                type="submit"
                                value="SUBMIT"
                                className="form-input-btn"
                            />
                        </div>
                    </div>
                </form>
            </div>
        )
    }

}

export default Tracking;
